  const ctx=useContext(AuthContext)

  return (

   <React.Fragment>
     <MainHeader  />
      <main>
        {!ctx.isLoggedIn && <Login />}
        {ctx.isLoggedIn && <Home />}
      </main>
   </React.Fragment>




  );
  }

export default App;
